import React from 'react'
import {
  Container,
  AppBar,
  Toolbar,
  IconButton,
  Badge,
  Typography,
} from "@material-ui/core";
import { ShoppingCart } from "@material-ui/icons";
import "./style.css";

export class index extends React.Component {
	render() {
		return (
			<>
				<AppBar position="fixed" className="custom-navbar">
				</AppBar>
			</>
		)
	}
}

export default index
